INSERT INTO records VALUES ('5e98dd86-e3c7-4a8b-895f-d555dde45566', '1', 'de', 'swissimage', 'Das Orthophotomosaik SWISSIMAGE ist eine Zusammensetzung digitaler Farbluftbilder. Ein Orthophoto ist ein Luftbild bei dem die Neigungseinflüsse der Kamera und des Geländes korrigiert wurden. SWISSIMAGE bietet somit einen einheitlichen Massstab und eine einheitliche Radiometrie über die Gesamtheit der Schweiz an. Verschiedene Auflösungen (Grösse vom Pixel am Boden), von 25 cm bis 250 cm, stehen im Bereich der Schweiz und dem Fürstentum Liechtenstein zur Verfügung.', '2015', '', 'Schweiz', NULL, 'Raster', 'Bundesamt für Landestopologie', 'https://shop.swisstopo.admin.ch/de/products/images/ortho_images/SWISSIMAGE', 'https://geodata4edu.hsr.ch/geodata1/rest/services/BASEMAPS/swissimage/ImageServer', 'https://geodata4edu.hsr.ch/geodata1', 'BASEMAPS', 'swissimage', '', '', '', '', 'ImageServer', '21781', 'http://geodatenkompass.hsr.ch/gdimetadata/G4SE/Datennutzungsvereinbarung.pdf', NULL, 'hsr-internal', '2016-08-18 17:29:44.482941', 'patricia.meier', '''25'':50A ''250'':53A ''auflos'':43A ''basemaps'':67A ''bereich'':57A ''bietet'':27A ''bod'':48A ''cm'':51A,54A ''digital'':8A ''einheit'':30A,34A ''farbluftbild'':9A ''furstentum'':62A ''geland'':23A ''gesamt'':38A ''gross'':44A ''kamera'':20A ''korrigiert'':24A ''liechtenstein'':63A ''luftbild'':14A ''massstab'':31A ''neigungseinfluss'':18A ''orthophoto'':11A ''orthophotomosa'':3A ''pixel'':46A ''radiometri'':35A ''schweiz'':40A,59A,66A ''somit'':28A ''steh'':55A ''swissimag'':1A,4A,26A,68A ''verfug'':65A ''verschied'':42A ''wurd'':25A ''zusammensetz'':7A', '''25'':50A ''250'':53A ''auflos'':43A ''basemaps'':67A ''bereich'':57A ''bietet'':27A ''bod'':48A ''cm'':51A,54A ''digital'':8A ''einheit'':30A,34A ''farbluftbild'':9A ''furstentum'':62A ''geland'':23A ''gesamt'':38A ''gross'':44A ''kamera'':20A ''korrigiert'':24A ''liechtenstein'':63A ''luftbild'':14A ''massstab'':31A ''neigungseinfluss'':18A ''orthophoto'':11A ''orthophot