INSERT INTO records VALUES ('cd58d7fc-a44d-4199-b798-2127e4efcdca', '2', 'de', 'Landeskarte 1:100''000', 'Die Landeskarte 1:100''000 ist eine überregionale, topografische Karte der Schweiz. Der Kartenperimeter ist in 23 Einzelblätter aufgeteilt. Von ausgewählten Regionen existieren Zusammensetzungen. Die Nachführung erfolgt sektorenweise mit einem Nachführungszyklus von 6 Jahren. Die Landeskarte 1:100''000 ist in analoger (Papierkarte) und in digitaler (Swiss Map Raster) Form verfügbar. Die Kartenblätter der gedruckten Papierausgabe sind gefalzt und ungefalzt erhältlich. Die Swiss Map Raster ist die digitale Landeskarte 1:100''000 und wird als georeferenzierte TIF-Datei (Rasterformat) geliefert. Die Karteninformation ist nach Farbebenen getrennt, jedoch nicht nach thematischen Kartenelementen gegliedert. Die Pixelkarten stehen als Farbkombination (254 dpi und 508 dpi) oder als farbgetrennte Layer (Binärdaten 508 dpi) zur Verfügung, und sie können einzelblattweise oder als individueller Perimeterausschnitt bezogen werden.', '2016', '', 'Schweiz', NULL, 'Raster', 'Bundesamt für Landestopologie', 'https://shop.swisstopo.admin.ch/de/products/maps/national/digital/srm100', 'https://geodata4edu.hsr.ch/geodata1/rest/services/BASEMAPS/pixelkarte100/ImageServer', 'https://geodata4edu.hsr.ch/geodata1', 'BASEMAPS', 'pixelkarte100', '', '', '', '', 'ImageServer', '21781', 'http://geodatenkompass.hsr.ch/gdimetadata/G4SE/Datennutzungsvereinbarung.pdf', NULL, 'public', '2016-08-19 08:41:17.698055', 'patricia.meier', '''000'':4A,9A,43A,76A ''1'':2A,7A,41A,74A ''100'':3A,8A,42A,75A ''23'':21A ''254'':103A ''508'':106A,113A ''6'':37A ''analog'':46A ''aufgeteilt'':23A ''ausgewahlt'':25A ''basemaps'':127A ''bezog'':125A ''binardat'':112A ''datei'':83A ''digital'':50A,72A ''dpi'':104A,107A,114A ''einzelblatt'':22A ''einzelblattweis'':120A ''erfolgt'':31A ''erhalt'':65A ''existi'':27A ''farbeb'':90A ''farbgetrennt'':110A ''farbkombination'':102A ''form'':54A ''gedruckt'':59A ''gefalzt'':